                        </div>
                    )
                })
            }
        </div>
        <Grid
            container
            justify="center"
            alignItems="center"
            >
               <Pagenation passedUrl={passedMovieUrl}/> 
            </Grid>


        </div>

    )
}

export default MovieList;
